            WriteLiteral(@"

<fielset>
    <legend>Quem Somos</legend>
    <hr />

    O PRODERJ - Centro de Tecnologia de Informação e Comunicação do Estado do Rio de Janeiro, autarquia vinculada à
    Secretaria de Estado da Casa Civil, é o órgão central de Tecnologia de Informação e Comunicação (TIC) do Governo do
    Estado, desempenhando o importante papel de propor diretrizes e orientações técnicas voltadas para o estabelecimento
    da política de TIC no âmbito da administração pública estadual.



    Criado como Fundação CPDERJ – Centro de Processamento de Dados do Estado do Rio de Janeiro – pelo Decreto-Lei nº
    6.097, de 09 de julho de 1968, o PRODERJ foi transformado em autarquia em 16 de junho de 1981, pelo Decreto 4.188.
    Em 28 de dezembro de 2004, teve suas atribuições atualizadas e seu nome alterado pela Lei 4.480.



    Ao incorporar as novas funções de integrador e homologador de soluções, gerador de normas e padrões e disseminador
    de novas tecnologias para a TIC pública, o PRODERJ evolui");
            WriteLiteral(@"u, deixando de ser apenas um centro de processamento de
    dados e se tornando, de forma cada vez mais efetiva, o responsável pelos sistemas corporativos e pela gestão da Rede
    Governo, provendo serviços de Internet, soluções e atividades afins para o Governo do Estado.



    Na edição de 18 de setembro de 2020, foi publicado no Diário Oficial o Decreto N° 47.278, que alterou a estrutura
    organizacional e a política de Tecnologia da Informação e Comunicação (TIC) no âmbito estadual. O Decreto, que
    consolida a atuação da autarquia como órgão central da tecnologia no Estado, busca otimizar e tornar o planejamento
    e a gestão da TIC mais eficiente, com vistas ao melhor atendimento do cidadão e aos servidores públicos.



    O foco principal em todas as ações realizadas pelo PRODERJ tem sido a modernização e digitalização do Estado e
    colocar a tecnologia a serviço da população, integrando os serviços dos diversos órgãos de maneira digital, segura e
    eficiente. A sede principa");
            WriteLiteral("l da autarquia está localizada no Centro – situada na Rua da Conceição, 69, Centro / Rio\r\n    de Janeiro. Neste local, funcionam a Presidência, as Vice-Presidências, as Diretorias e as Gerências do órgão.\r\n</fielset>\r\n");
